def computeAvg():
    avgP = {}
    counters = {}
    for key in used_parameters:
        for p in parameters:
            if not (key in avgP):
                avgP[key] = 0
                counters[key] = 0
            if key in p:
                avgP[key] += p[key]
                counters[key] += 1

    for elem in counters:
        avgP[elem] = avgP[elem] / counters[elem]

    return avgP


def computeVar(avgP):
    varP = {}
    counters = {}
    for key in used_parameters:
        for p in parameters:
            if not (key in varP):
                varP[key] = 0
                counters[key] = 0
            if key in p:
                varP[key] += (p[key] - avgP[key]) * (p[key] - avgP[key])
                counters[key] += 1

    for elem in counters:
        varP[elem] = varP[elem] / counters[elem]

    stdP = {}
    for key in varP:
        stdP[key] = math.sqrt(varP[key])

    return avgP, stdP


